import './App.css';
import Login from './component/login'
import { Route, Switch} from 'react-router-dom';
import PrivateRoute from './route/private_route'
import ReRoute from '../'
import Document from "./component/document"

function App() {
  return (
    <>
      <Switch>
        <PrivateRoute exact path='/document'></PrivateRoute>
        <ReRoute path='/login' component={Login} />
      </Switch>
    </>
  );
}

export default App;
